import React from 'react';
import styles from './navBar.module.css';

const NavBar = () => {
    return(
        <div className={styles.containerNav}>
            <h1 className={styles.title}>Individual Dog Project</h1>
            <input type="text" placeholder='Find dog breeds' />
        </div>
    )
}

export default NavBar;
